B.ayK=A.a(s(["XBLD[[Barometras]] - j\u012f sudar\u0117 tori\u010delio bandyme pavaizduotas stiklinis vamzdelis, prie kurio buvo pritaisyta skal\u0117. Kadangi, kintant atmosferos sl\u0117giui, kinta gyvsidabrio stulpelio auk\u0161tis, tai pagal vamzdelyje pa\u017eym\u0117tas padalas galima su\u017einoti atmosferos sl\u0117g\u012f. Ta\u010diau \u0161ie barometrai yra nepatog\u016bs naudoti, kadangi gyvsidabrio garai nuodingi, tod\u0117l gyvsidabrio pavir\u0161iaus negalima palikti atviro.","XBLD[[Aneroidas]] - min\u0117t\u0173 pirmojo barometr\u0173 tr\u016bkum\u0173 neturintis dabar labiau paplit\u0119s barometras. Aneroid\u0105 sudaro metalin\u0117 banguotu pavir\u0161iumi d\u0117\u017eut\u0117 (1 pav.), i\u0161 kurios i\u0161siurbtas oras (2 pav, ITAL[[a]]). Kad atmosferos sl\u0117gis nesugniu\u017edyt\u0173 d\u0117\u017eut\u0117s, jos dangtel\u012f prilaiko spyruokl\u0117 ITAL[[b]]. Kintant sl\u0117giui, dangtelis tai \u012fdumba, tai i\u0161sitiesia. Kinta ir prie jos pritvirtintos spyruokl\u0117s pad\u0117tis. Svertas ITAL[[c]] jungia spyruokl\u0119 su prietaiso rodykle, galin\u010dia pasisukti \u012f kair\u0119 arba \u012f de\u0161in\u0119. Po rodykle \u012ftaisyta skal\u0117, kuri sugraduota sl\u0117gio vienetais, lyginant aneroido rodmenis su gyvsidabrio barometro rodmenimis."]),t.s)
B.axX=new A.b3(B.ayK,"|N_2|","XBLD[[\u2022 ]]",8,null)
B.aCH=A.a(s(["XBLD[[1. ]];XBLD[[Pakelti vir\u0161 \u017dem\u0117s pavir\u0161iaus k\u016bnai.]]|N_1|BOLD[[Pvz.:]] Leisdamasis \u017eemyn, pasvaras traukia ve\u017eim\u0117l\u012f ITAL[[(1 pav.)]], nukrit\u0119s metalinis rutuliukas i\u0161mu\u0161a duobut\u0119 sm\u0117lyje, u\u017etvenktos up\u0117s vanduo suka hidroelektrin\u0117s turbinas.",'XBLD[[2. ]];XBLD[[Deformuoti tampr\u016bs k\u016bnai.]]|N_1|BOLD[[Pvz.:]] Suspausta balistinio pistoleto spyruokl\u0117 i\u0161sitiesdama \u201ei\u0161\u0161auna" metalin\u012f rutuliuk\u0105, deformuotas lankas \u2014 str\u0117l\u0119.',"XBLD[[3. ]];XBLD[[Judantys k\u016bnai.]]|N_1|BOLD[[Pvz.:]] Judan\u010dio oro srautas \u2014 v\u0117jas \u2014 gena burin\u012f laiv\u0105, \u012f stulp\u0105 ar kuri\u0105 nors kit\u0105 kli\u016bt\u012f atsitrenk\u0119s automobilis deformuojasi, paleistas ried\u0117ti pasvirusiu loveliu metalinis rutuliukas nustumia jo kelyje pad\u0117t\u0105 ritin\u0117l\u012f ITAL[[(2 pav.)]]."]),t.s)
