B.b4z=new A.bZ('Formuli\u0173 i\u0161rei\u0161kimas algebriniu b\u016bdu patartinas tiems, kas nori mok\u0117ti i\u0161rei\u0161kti bet kokias formules universaliu, pla\u010diausiai naudojamu b\u016bdu. BOLD[[Nors jis gali pasirodyti gana sud\u0117tingas i\u0161 prad\u017ei\u0173, greitai supratus \u0161io b\u016bdo esm\u0119 jis tampa paprastu.]]|N_4|\u0160is b\u016bdas, kitaip nei "trikampis", XBLD[[tinka visoms formul\u0117ms]], nesvarbu i\u0161 kiek kintam\u0173j\u0173 ar matematini\u0173 \u017eenkl\u0173 jos sudarytos. XBLD[[Tai vienintelis b\u016bdas i\u0161reik\u0161ti ne\u017einom\u0105j\u012f i\u0161 dviej\u0173 ar daugiau sulygint\u0173 lyg\u010di\u0173.]]',!1,16,null)
B.b4A=new A.bZ('Formuli\u0173 i\u0161sirei\u0161kimas "trikampiu" XBLD[[patartinas tiems, kas nori paprastas, trij\u0173 dyd\u017ei\u0173 formules i\u0161sireik\u0161ti paprastai ir greitai, daug negalvojant ir nesprend\u017eiant laiko pertvarkymams]].|N_4|Ta\u010diau, \u0161is b\u016bdas netinka visoms formul\u0117ms i\u0161sireik\u0161ti. Juo galima naudotis BOLD[[tik turint vien\u0105 formul\u0119, sudaryt\u0105 i\u0161 trij\u0173 ar keturi\u0173 ne\u017einom\u0173j\u0173, kuri\u0173 tik vienas t\u0117ra trupmenos skaitiklyje]] (arba kitaip tariant, tik pa\u010dioms papras\u010diausioms formul\u0117ms).',!1,16,null)
B.b4B=new A.bZ("Kaitinant k\u016bnus, juos sudaran\u010dios dalel\u0117s pradeda grei\u010diau jud\u0117ti arba smarkiau svyruoti, tod\u0117l padid\u0117ja vidutiniai atstumai tarp j\u0173, taigi ir viso k\u016bno matmenys bei t\u016bris. I\u0161 jo poky\u010dio galima spr\u0119sti apie k\u016bno temperat\u016br\u0105, tod\u0117l \u0161iluminis k\u016bn\u0173 pl\u0117timasis gali b\u016bti temperat\u016bros matas.|N_2|BOLD[[Taigi, k\u016bn\u0173 temperat\u016brai kylant jie ple\u010diasi.]]",!1,16,null)
